import "./header.css";
import logo from "../../assets/img/logo.png";

function Header() {
  return (
    <div className="header section__padding" id="home">
      <div className="header-content">
        <h1>Always Track & Analyze Your Business Statistics To Succeed.</h1>
      </div>
    </div>
  );
}

export default Header;
